import Card from "react-bootstrap/Card";
import './ReviewPane.css';
const ReviewPane = (reviewData) => {
    console.log(reviewData.reviewData);
    return (
        <div>
            <Card>
                <Card.Body>
                    <article className="media">
                        <div className="media-content">
                            <div className="content">
                                <div className="user-name">{reviewData.reviewData._source.reviewer} </div>
                                <div className="contributions">{reviewData.reviewData._source.contributions} Contributions</div>
                                <div className="review-title">{reviewData.reviewData._source.review_title} </div>
                                <p className="comment">{reviewData.reviewData._source.comment}</p>
                            </div>
                        </div>
                    </article>
                </Card.Body>
            </Card>
        </div>
    );
};
export default ReviewPane;
